import React, { Component } from "react";

import "./Library.css";
import "../../assets/style.css";

import Nav from "../Nav/Nav";
import RecordsContainer from "../RecordsContainer/RecordsContainer";
import { getRecords } from "../../services/RecordService";

class Library extends Component {

  state = {};

  constructor(props) {
    super(props);

    this.state = { records: [] }

    this.setupLoop = this.setupLoop.bind(this);

    console.log(this.state.records);

  }

  componentDidMount(){



  }

  setupLoop() {

    const recordsArray = getRecords();
    recordsArray.then((data)=>{

      this.setState({records: data})

      console.log(this.state.records);


    })

  }

  render() {

    return (
      <div className="main">
        <Nav></Nav>
        <div className="title">
          <h1>Recentes</h1>
        </div>
        <RecordsContainer key="records_container" records={this.state.records}></RecordsContainer>
      </div>
    );
  }
}

export default Library;
